import './App.css';
import React, {Component} from 'react';
import Navbar from './components/Navbar';
import News from './components/News';
// import PropTypes from 'prop-types'
import {
  BrowserRouter as Router,
Routes,
Route
} from 'reac'


export default class App extends Component {
  render () {
    return (
      <div><Router>
        <Navbar />
        <Switch>
            <Route path="/"> <News pageSize={5} country="us" category="general"/>
            </Route>
            <Route path="/business"> <News pageSize={5} country="us" category="business"/>
            </Route>
            <Route path="/enetertainment"> <News pageSize={5} country="us" category="enetertainment"/>
            </Route>
            <Route path="/general"> <News pageSize={5} country="us" category="general"/>
            </Route>
            <Route path="/health"> <News pageSize={5} country="us" category="health"/>
            </Route>
            <Route path="/sceirnce"> <News pageSize={5} country="us" category="sceirnce"/>
            </Route>
            <Route path="/sports"> <News pageSize={5} country="us" category="sports"/>
            </Route>
            <Route path="/technology"> <News pageSize={5} country="us" category="technology"/>
            </Route>
        </Switch>
        <News pageSize={5} country="us" category="general"/>
        </Router>
      </div>
    );
  }
}
